@brucewilliamsstudio4932 , that can happen, (ballbearing stuck)  but it didn't happen here. burningmarks are slightly different from cutting marks. it doesn't look burnt. In addition, the damage is not where the bearing was guided but above where the cutting edge was.

and if material sticks to the bearing, it increases the diameter, which means that the cutting edge of the router bit no longer cuts flat. @brucewilliamsstudio4932
